import React from "react";

function BarChart() {
  // Generate random values for the bar chart
  const data = Array.from({ length: 5 }, () => Math.floor(Math.random() * 100));

  return (
    <div>
      <h2>Bar Chart</h2>
      <div>
        {data.map((value, index) => (
          <div
            key={index}
            style={{
              height: `${value}px`,
              backgroundColor: "blue",
              margin: "5px",
            }}
          ></div>
        ))}
      </div>
    </div>
  );
}

export default BarChart;
